import './Input.css'
import Box from '@mui/material/Box';
export default function Input({type,placeholder})
{
return(<Box className="StyledInput"> 
    <Input type="text" placeholder="Email"/>
    <Input type="password" placeholder="password"/>
     </Box>
);


}
